import SearchIcon from '@mui/icons-material/Search';
import { Link } from 'react-router-dom';
const Navbar = () => {
  return (
   <div className='container-fluid' id='navbar'>
      <div id='wrapper'>
        <div id='left'>
          <div id='item'>
            <img src="" alt=''/>
          </div>
        </div>
        <div id="center">

        </div>
        <div id='right'>
          
        </div>



      </div>

   </div>
  )
}

export default Navbar
